/**Plugin start */
$("body").append('<div id="sitepower" class="chatbox chatbox--tray"/>');
(function( $ ) {
    $.fn.sitepower = function() {
        var fileSvg = "data:image/svg+xml;base64,"
        var sendSvg = "data:image/svg+xml;base64,";
        var attachSvg = "data:image/svg+xml;base64,";
        var $contMin = $('<div class="chatbox__title"><h5><a href="#">Напишите нам!</a></h5><div class="chat-logo"></div></div>');
        var $contFull = $('<div/>');
        var $contFullHead = $('<div class="chatbox__title__full"><h5><a href="#">Онлайн диалог</a></h5><button class="chatbox__title__close"><span><svg viewBox="0 0 12 12" width="12px" height="12px"><line stroke="#FFFFFF" x1="11.75" y1="0.25" x2="0.25" y2="11.75"></line><line stroke="#FFFFFF" x1="11.75" y1="11.75" x2="0.25" y2="0.25"></line></svg></span></button></div>');
        var $contFullBody = $("<div/>");

        var $bChat = $("<div class='chatbox__body'/>")/*.append("<div id='chatarea'><ul></ul></div>")*/;
        var $bInput = $("<div class='chatbox__message'/>").append('' +
            '<div class="pin">' +
            '  <input type="file" name="file-6[]" id="file-6" class="inputfile inputfile-5" hidden data-multiple-caption="{count} files selected" multiple />' +
            '  <label for="file-6"><img src="' + attachSvg + '" width="16px" height="16px" alt=""></label>' +
            '</div>' +
            '<br/>'+
            // '<div class="smile ml-2"><i class="fas fa-smile"></i></div>' +
            '<textarea placeholder="Напишите сообщение..."></textarea>' +
            '<div class="send" title="Отправить"><img src="' + sendSvg+ '" height="23px" width="25px" alt=""></div>' +
            '');


        //var $bSend = $("<div class='send' title='Отправить'/>").append('<img src="' + sendSvg+ '" height="13px" width="15px" alt="">');
        var widget_id = "%%WIDGET_ID%%";

        var sitepower_id = localStorage.getItem("sitepower_id");

        var api_url = "%%DOMAIN%%";
        var chat_url = "%%DOMAIN%%";

        $contFullBody.append($bChat).append($bInput);
        $contFull.append($contFullHead).append($contFullBody);
        $(this).append($contMin);
        $(this).append($contFull);
        $contFull.hide();
        $contMin.hide();
        $contMin.on("click", function (event) {
            event.preventDefault();
            $("#sitepower").toggleClass('chatbox--tray');
            $contFull.show();
            $contMin.hide();
            $(".chatbox__body").scrollTop($(".chatbox__body").prop("scrollHeight"));

        });
        $contFullHead.on("click", function (event) {
            event.preventDefault();
            $("#sitepower").toggleClass('chatbox--tray');
            $contFull.hide();
            $contMin.show();
        });
        try {
            $.post(api_url + '/api/prospect/get/' + widget_id , {prospect_id: sitepower_id}).done(function (data) {
                sitepower_id = data.sitepower_id;
                localStorage.setItem("sitepower_id", sitepower_id);
                connect();
            }).fail(function (err) {
                throw new Error(err.toString())
            });
        } catch (e) {
            console.log(e.toString());
            return;
        }
        function connect() {
            var socket = io(chat_url + '/?sitepower_id='+sitepower_id);
            socket.on('connect', function () {
                /*get chat history by sitepower_id*/
                $.get(api_url + '/api/prospect/chat/' + sitepower_id).done(function (data){
                    if (data) {
                        data.forEach(function(item){addMsg(item)});
                    }

                }).fail(function (err) {console.log(err.message)});

                $.get(api_url + '/api/prospect/form/' + widget_id).done(function (data){
                    console.log("data");
                    console.log(data);
                    $('#sitepower .chatbox__message textarea').attr('placeholder', data.message_placeholder);
                    $('#sitepower .chatbox__title a').text(data.label);
                    if (data.gradient === "0") {
                        $('#sitepower .chatbox__title').addClass('collapse_color');
                        $('#sitepower .chatbox__title__full').addClass('collapse_color');
                    } else {
                        $('#sitepower .chatbox__title').addClass('collapse_gradient');
                        $('#sitepower .chatbox__title__full').addClass('collapse_gradient');
                    }
                    $('#sitepower .chatbox__title').addClass('color-' + data.color);
                    $('#sitepower .chatbox__title__full').addClass('color-' + data.color);



                    //chatbox__title

                    if ($contMin.is(':hidden') && $contFull.is(':hidden')  && socket.connected) {
                        $contMin.show();
                    }
                }).fail(function (err) {console.log(err.message)});





            });
            socket.on('connect_error', function(error) {
                console.log("connect_error!!!");
            });


            $messageText = $("#sitepower .chatbox__message textarea");
            $messageText.focus();

            $("#sitepower .send").on("click", function(event){
                if (!$messageText.val()) return;
                var msg = {};
                msg.body = $messageText.val();
                msg.type = "text";
                msg.link = "";

                socket.emit("send", msg);
                $messageText.val("");

            });
            $messageText.on("keydown", function (event) {
                if (event.keyCode === 13) {
                    event.preventDefault();
                    $("#sitepower .send").click();
                    return;
                }
                if (/[а-яА-Яa-zA-Z0-9-_ ]/.test(String.fromCharCode(event.keyCode))) {
                    var msg = {};
                    msg.body = "";
                    msg.type = "print";
                    msg.link = "";
                    socket.emit("print", msg);
                }
            });
            var $inputFile = $("#sitepower .pin .inputfile");
            $inputFile.on("change", function(event){
                var inpFile = $inputFile[0];
                for (var i = 0; i < inpFile.files.length; i++) {
                    if (inpFile.files[i].size > 5242800) {
                        alert("Невозможно прикрепить файл более 5 Мб!");
                        return;
                    }
                    var file = inpFile.files[i];
                    var formData = new FormData();
                    formData.append('file', file);
                    formData.append('filename', file.name);

                    //$.post(api_url + "/upload", formData, {headers: {'Content-Type': 'multipart/form-data'}});
                    $.ajax({
                        type: "POST",
                        url: 'http://' + api_url + "/api/upload",
                        data: formData,
                        processData: false,
                        contentType: false,
                        success: function(res){
                            var msg = {};
                            msg.body = res.file;
                            msg.type = "link";
                            msg.link = res.url;
                            socket.emit("send", msg);
                        }
                    });
                }

            });
            socket.on("receive", function(data){
                console.log("receive");
                if (data.msg)
                    addMsg(data.msg);
            });

            socket.on("print", function(){
                console.log("print");

            });

            socket.on('disconnect', function (reason) {
                console.log("disconnect: " + reason);
                $contFull.hide();
                $contMin.hide();
            });
            socket.on('error', function (error) {
                console.log("error: " + error);
            });
        }

        function addMsg (msg) {
            var htmlMsg = "";
            var tmMsg = new Date(msg.created);
            var tmMsgStr = "";
            var today = new Date;
            today.setHours(0);
            var day = tmMsg.getDate().toString().length === 2 ? tmMsg.getDate() : "0" + tmMsg.getDate();
            var mon = tmMsg.getMonth();
            var hrs = tmMsg.getHours().toString().length === 2 ? tmMsg.getHours() : "0" + tmMsg.getHours();
            var min = tmMsg.getMinutes().toString().length === 2 ? tmMsg.getMinutes() : "0" + tmMsg.getMinutes();
            var sec = tmMsg.getSeconds().toString().length === 2 ? tmMsg.getSeconds() : "0" + tmMsg.getSeconds();

            var months = ["Января", "Февраля", "Марта", "Апреля", "Мая", "Июня", "Июля", "Августа", "Сентября", "Октября", "Ноября", "Декабря"]


            if (tmMsg > today) {
                tmMsgStr = hrs + ":" + min + ":" + sec
            } else {
                tmMsgStr = day + " " + months[mon] + " " + hrs + ":" + min
            }



            if (msg.type === "text" && msg.direction === "to_user") {
                htmlMsg =
                    '<div class="chatbox__body__message chatbox__body__message--left">' +
                    '    <div class="info-left">' +
                    '      <small class="text-muted">Вы</small>' +
                    '      <small class="text-muted">' + tmMsgStr + '</small>' +
                    '    </div>' +
                    '    <p>' + msg.body + '</p>' +
                    '</div>'
            } else if (msg.type === "text" && msg.direction === "from_user") {
                htmlMsg =
                    '<div class="chatbox__body__message chatbox__body__message--right">' +
                    '    <div class="info-right">' +
                    '      <small class="text-muted">Оператор</small>' +
                    '      <small class="text-muted">' + tmMsgStr + '</small>' +
                    '    </div>' +
                    '    <p>' + msg.body + '</p>' +
                    '</div>'
            } else if (msg.type === "link" && msg.direction === "from_user") {
                htmlMsg =
                    '<div class="chatbox__body__message--file chatbox__body__message__right--file">' +
                    '     <div class="info-right">' +
                    '       <small class="text-muted">Оператор</small>' +
                    '       <small class="text-muted">' + tmMsgStr + '</small>' +
                    '     </div>' +
                    '     <div class="info-file">' +
                    '       <div class="info-file__left">' +
                    '         <img src="' + fileSvg + '" height="16px" width="16px"/>' +
                    '       </div>' +
                    '       <div class="info-file__right">' +
                    '         <p class="info-file__name">' + msg.body + '</p>' +
                    '         <p class="info-file__info"><a href="' + msg.link + '" target="_blank">Скачать</a></p>' +
                    '       </div>' +
                    '     </div>' +
                    ' </div>'
            } else if (msg.type === "link" && msg.direction === "to_user") {
                htmlMsg =
                    '<div class="chatbox__body__message--file chatbox__body__message__left--file">' +
                    '     <div class="info-left">' +
                    '       <small class="text-muted">Оператор</small>' +
                    '       <small class="text-muted">' + tmMsgStr + '</small>' +
                    '     </div>' +
                    '     <div class="info-file">' +
                    '       <div class="info-file__left">' +
                    '         <img src="' + fileSvg + '" height="16px" width="16px"/>' +
                    '       </div>' +
                    '       <div class="info-file__right">' +
                    '         <p class="info-file__name">' + msg.body + '</p>' +
                    '         <p class="info-file__info"><a href="' + msg.link + '" target="_blank">Скачать</a></p>' +
                    '       </div>' +
                    '     </div>' +
                    ' </div>'
            }

            $bChat.append($(htmlMsg));
            $(".chatbox__body").scrollTop($(".chatbox__body").prop("scrollHeight"));
        }
    };
    $("#sitepower").sitepower();
})($);

